    isStrikeInSLL(strike) {
        let sll_details = '';
        if (this.sl_trades.length > 0) {
            for (let i = 0; i < this.sl_trades.length; i++) {
                let element = this.sl_trades[i];
                if (element.scrip === strike) {
                    sll_details += element.price + ',';
                }
            }
        }
        sll_details = sll_details.replace(/,\s*$/, '');
        if (sll_details === '') {
            sll_details = null;
        }
        return sll_details;
    }
